import React, { Component } from 'react';
import ProShow from '../Components/ProShow'

class Projects extends Component {
  render() {
    return (
        <div style={{"position":"relative"}}>
        <div style={{"width":"100%","height":"100vh","z-index":"-9"}}>
          <div className="skew3" style={{"width":"100%","height":"100%","position":"absolute"}}>
          </div>
          <div style={{"width":"90%","textAlign":"center","position":"absolute"}}>
            <div style={{"marginTop":"240px","marginLeft":"180px"}}>
              <ProShow />
            </div>
          </div>
        </div>

        </div>
    )
  }
}

export default Projects;
